import React from 'react'
import Home from './Home'
import Dtav from './Components/Dtav/Dtav'
import { BrowserRouter as Routes, Route, Switch } from 'react-router-dom'
import './App.css';

function App() {

  return (
    <div className="App">
    <React.Fragment>
      <Router>
      <Navigation>
        <Switch>
          <Route path="/" element={<Home/>}/>
          <Route path="/dtav" element={<Dtav />} />
        </Switch>
        </Navigation>
    </Router>
  </React.Fragment>
  </div>
  );
}

export default App;
